import React from 'react';

type TodolistType = {
   task: Array<TaskType>
}

type TaskType = {
    id:string;
    title:string;
    isDone:boolean;
}

export  const Todolist = (props:TodolistType) => {
    return (
        <div>
            <input/>
            <button>Add</button>
                 {props.task.map((el)=>{
                     return (

                             <li key={el.id}>{el.title}
                                 <input type={'checkbox'} checked={el.isDone}/>
                                 <button>X</button>
                             </li>



                     )
                 })
                 }


        </div>
    );
};
